content:
The filter transformation removes records from an existing dataset. You define a filter condition that specifies which records to retain in the dataset.

To filter rows in a Data Prep recipe, see Filter Node: Filter Rows. To do it in a Data Prep Classic recipe, see Add a Filter in a Recipe.

You create a dataset that contains only opportunities that were Closed Won by extracting all opportunities from the Opportunity object and filtering the records so that you only include opportunities with a Closed Won stage name.

You can filter Salesforce object records at different levels:

* Transformation level: To filter a stream of data loaded into a dataset, add a filter transformation to the dataflow.
* Connection level: To prevent Salesforce records from being loaded into any dataset, add the filter on the connected object.

When you define a filter transformation, you set the action attribute to filter and specify the parameters. You create a filter expression in the filter transformation based on one or more dimensions in a dataset.

Example dataflow JSON:
{    
   "Extract_Opportunities": {        
      "action": "sfdcDigest",        
      "parameters": {            
         "object": "Opportunity",
         "fields": [                
            { "name": "Id" },                
            { "name": "Name" },                
            { "name": "Amount" },                
            { "name": "StageName" },                
            { "name": "CloseDate" },                
            { "name": "AccountId" },
            { "name": "OwnerId" }            
         ]  
      }    
   },    
   "Filter_Opportunities": {        
      "action": "filter",        
      "parameters": {            
         "filter": "StageName:EQ:Closed Won",            
         "source": "Extract_Opportunities"        
      }    
   },    
   "Register_My_Won_Oppportunities_Dataset": {        
      "action": "sfdcRegister",        
      "parameters": {            
         "alias": "MyWonOpportunities",            
         "name": "MyWonOpportunities",            
         "source": "Filter_Opportunities"        
      }    
   }
}
